        flex:1,
        flexDirection: 'row'
    }
    return(
        <div className="Container" style={ListStyle}>
        {cur.map(item=>(
            <Elem cur={item}/>
        ))}
            <p>List Presenter</p>
            <p>List Presenter</p>
            <p>List Presenter</p>
        </div>
    );
}   
